02-transport-protocol.html.body:
BOTD #2: Transport Protocol
Overview
All communications between two peers SHOULD be encrypted in order to provide confidentiality for all transcripts and is authenticated in order to avoid malicious interference. 
Transport announcement
Each peer MUST decide and MUST announce which transport protocol wants to use for the connection, one or more combined between:

Clear text insecure
Onion service onion
Server-side TLS TLS
Mutual TLS mTLS
Noise_XK_secp256k1_ChaChaPoly_SHA256 noise

Each peer SHOULD be reachable on the default TCP port 9945 and, if so, MUST expose then a plaintext HTTP/2 endpoint that announces the chosen transports responding with an AvailableTransport protobuf message, setting the response ContentType as application/protobuf
Data Structures
syntax = "proto3";

enum TransportType {
    INSECURE = 0;
    ONION = 1;
    TLS = 2;
    MTLS = 3;
    NOISE = 4;
}

message Transport {
    TransportType type = 1;
    string name = 2;
    bytes data = 3;
}

message AvailableTransport {
    repeated TransportType transport = 1;
}

Each Transport has an optional data field that can be used to return additional metadata. Eg. A static public key in case of noise or a self-signed TLS certificate in case of mTLS

03-swap-protocol.html.body:
BOTD #3: Swap protocol
Overview
The swap protocol defines the process wich two parties conclude an atomic swap using an interactive exchange of signed messages and Elements transaction.
Identifying with Alice as the Proposer and Bob the Responder:

Alice connects to Bob trough secure transport layer and encrypted connection.
Alice propose a swap crafting an unsigned transaction and a message defined as sending AMOUNT_P of ASSET_P and receiving AMOUNT_R of ASSET_R. If confidential, the blinding keys need to be included.
Alice sends to Bob the SwapRequest message containing the unsingned transaction. An additional input and eventual change output needed to pay half of the network fees is included by Alice in the transaction.
Bob, if accepts the terms, funds the swap and partially signs the proposed transaction and includes his blinding keys too.
Bob sends back to Alice the SwapAccept message containing the partially signed transaction. An additional input and eventual change output needed to pay the remaining half of the network fees is included by Bob in the transaction.
Alice parses the accepted swap and signs the transaction.
Alice sends to Bob the SwapComplete message containing the signed transaction.
Ideally Bob finalizes and broadcast the transaction to the Liquid network.

Swap
Data Structures
syntax = "proto3";

message SwapRequest {
  // Random unique identifier for the current message
  string id = 1;
  // The proposer's quantity
  uint64 amount_p = 2;
  // The proposer's asset hash
  string asset_p = 3;
  // The responder's quantity
  uint64 amount_r = 4;
  // The responder's asset hash
  string asset_r = 5;
  // The proposer's unsigned transaction in PSET format (base64 string)
  string transaction = 6;
  // In case of a confidential transaction the blinding key of each confidential
  // input is included. Each blinding key is identified by the prevout script
  // hex encoded.
  map input_blinding_key = 7;
  // In case of a confidential transaction the blinding key of each confidential
  // output is included. Each blinding key is identified by the output script
  // hex encoded.
  map output_blinding_key = 8;
}

message SwapAccept {
  // Random unique identifier for the current message
  string id = 1;
  // indetifier of the SwapRequest message
  string request_id = 2;
  // The partial signed transaction base64 encoded containing the Responder's
  // signed inputs in a PSET format
  string transaction = 3;
  // In case of a confidential transaction the blinding key of each confidential
  // input is included. Each blinding key is identified by the prevout script
  // hex encoded.
  map input_blinding_key = 4;
  // In case of a confidential transaction the blinding key of each confidential
  // output is included. Each blinding key is identified by the output script
  // hex encoded.
  map output_blinding_key = 5;
}

message SwapComplete {
  // Random unique identifier for the current message
  string id = 1;
  // indetifier of the SwapAccept message
  string accept_id = 2;
  // The signed transaction base64 encoded containing the Proposers's signed
  // inputs in a PSET format
  string transaction = 3;
}

message SwapFail {
  // Random unique identifier for the current message
  string id = 1;
  // indetifier of either SwapRequest or SwapAccept message. It can be empty
  string message_id = 2;
  // The failure code. It can be empty
  uint32 failure_code = 3;
  // The failure reason messaged
  string failure_message = 4;
}

SwapRequest
The SwapRequest message is sent by the Proposer to the Responder to start the swap negotiation. The transaction is as PSET base64 encoded string containing the Proposer's inputs and outputs (amount_r and eventual change).
SwapAccept
The SwapAccept message is sent by the Responder to the Proposer to accept the swap request.
SwapComplete
The SwapComplete message is sent by Proposer to the Responder to announce the successful completion of the swap. 
SwapFail
The SwapFail message can be sent by either side of the swap protocol, at any time, to announce the swap termination.
failure_code is an optional parameter for specifying the failure reason. TBD

04-trade-protocol.html.body:
BOTD #4: Trade protocol
The Trade protocol defines the public interface of a non-custodial exchange on top of an Elements-based chain such as Liquid Network. 
Overview
The centralized exchange main business is providing a venue for traders and market makers to register their offers to buy and sell in an order-book. In order to execute the orders, both are required to deposit funds and trust the exchange as custodian.  
TDEX aims to create an open network that connects traders and market makers directly to each other, without the need of a centralized custodian, exploiting the atomic swap capability of Elements-based chains for executing trades in a trustless fashion.
The market makers provide always-on endpoints and put liquidity in various asset pairs forming a specified interface called Market.  Each Market holds reserves of a base asset and a quote asset.
Anyone can become a liquidity provider and contribute with reserves in a non-custodial manner running an always-on endpoint to process trading requests. This is different than buying or selling; it requires depositing an equivalent value of both base and quote assets and select an automated market making strategy. 
A trader connects to the provider using the secure transport defined in the BOTD #2, fetches the current market price defined by the provider's strategy and makes an atomic swap using the swap protocol defined in the BOTD #3. Limit orders could be supported as well, delaying the time of execution of the swap proposal in the future.
Trade

The Provider deposits two reserves for each asset forming a Market, defined as a pair of BASE ASSET and QUOTE ASSET, and expose a public reachable endpoint.
The Trader fetches from the Provider the list of supported pairs and linked provider's fees.
The Trader passing a supported market in the request recognized by the hashes of two assets, fetches the current market rate
The Trader proposes a new swap request using the price given and awaits for Provider's response.
If the Provider accepts the terms will send back a swap accept message containing the partially signed transaction.
The Trader sends the signed transaction to finalize the trade using the swap complete message.
The Provider will finalize and broadcast the transaction to the network for on-chain settlement.


NOTICE: The Trader could skip point 6-7 and right away broadcast the transaction himself. Even if valid would be better for clients software to let the Provider be aware of the finalized transaction id rather than watch the blockchain to scan for known swaps.

Data Structures

Service Interface

service Trade {
  rpc Markets(MarketsRequest) returns (MarketsReply);
  rpc Balances(BalancesRequest) returns (BalancesReply);
  rpc MarketPrice(MarketPriceRequest) returns (MarketPriceReply);
  rpc TradePropose(TradeProposeRequest) returns (stream TradeProposeReply);
  rpc TradeComplete(TradeCompleteRequest) returns (stream TradeCompleteReply);
}


Messages 

message MarketsRequest {}
message MarketsReply { repeated MarketWithFee markets = 1; }

message BalancesRequest { Market market = 1; }
message BalancesReply { repeated BalanceWithFee balances = 1; }

message MarketPriceRequest {
  Market market = 1;
  TradeType type = 2;
  uint64 amount = 3;
}
message MarketPriceReply { repeated PriceWithFee prices = 1; }

message TradeProposeRequest {
  Market market = 1;
  TradeType type = 2;
  SwapRequest swap_request = 3;
}
message TradeProposeReply {
  SwapAccept swap_accept = 1;
  SwapFail swap_fail = 2;
  uint64 expiry_time_unix = 3;
}

message TradeCompleteRequest {
  SwapComplete swap_complete = 1;
  SwapFail swap_fail = 2;
}
message TradeCompleteReply { string txid = 1; }


Custom Types 

enum TradeType {
  BUY = 0;
  SELL = 1;
}
message Fee {
  string asset = 1;
  int64 basis_point = 2;
}
message Balance {
  int64 base_amount = 1;
  int64 quote_amount = 2;
}
message BalanceWithFee {
  Balance balance = 1;
  Fee fee = 2;
}
message Market {
  string base_asset = 1;
  string quote_asset = 2;
}
message MarketWithFee {
  Market market = 1;
  Fee fee = 2;
}
message Price {
  float base_price = 1;
  float quote_price = 2;
}
message PriceWithFee {
  Price price = 1;
  Fee fee = 2;
  uint64 amount = 3;
}

Glossary

Liquidity Provider: Holds reserves of pegged Bitcoin (eg. L-BTC) and an associated Elements asset in his non-custodial wallet, running automated market-making strategies both with or without an oracle. Providers are incentivized to be always on and need to expose a public reachable endpoint either via clearnet or using a Onion hidden service

Market: A single provider putting liquidity into an asset pair forms a market defines as BASE_ASSET-QUOTE_ASSET. Multiple markets can co-exist, although this is less beneficial for signaling offers to traders. 

Trader: Proposes new swaps using the provider's market rate. A trader can come and go, he only needs to support the swap protocol defined in the BOTD #3 and he can swap between the two assets in the Market in either direction by adding to the liquidity reserve of one and withdrawing from the reserve of the other. Traders can either connect directly to a provider if they already know the endpoint.

Pool: Providers can register into a distributed service mesh with other providers pooling together liquidity. This acts as a first responder for traders to lookup for provider's aggregated offers. A provider could run alone OR in a pool, but not both at the same time with the same reserves.

Liquidity fee: A small liquidity provider fee can be taken out of each trade and added to the reserves, besides the chain fee. While the BASE_ASSET-QUOTE_ASSET reserve ratio is constantly shifting, fees make sure that the total combined reserve size increases with every trade.
Guaranteed arbitrage opportunities from price fluctuations should push a steady flow of transactions through the system and increase the amount of fee revenue generated.

Automated Market Making: A liquidity provider has full control over the market making strategy to apply needed to calculate the market rate at which to accept trades. That being said, there is a possibility to apply an automated market-making relying only on the reserves balances and the amount requested by the trader, without the need to connect to an external price feed. One of the most famous algorithms is called constant product market-making. In short, this model generates a full order-book based on an initial price for the market. Every transaction that occurs on this market will adjust the prices of the market accordingly. It's a basic supply and demand automated market making system.
